import React, { useState } from "react";
import styled from "styled-components";

const TestList = () => {
  let [list, listChange] = useState([
    { id: 1, name: "A", age: 1 },
    { id: 2, name: "B", age: 2 },
    { id: 3, name: "C", age: 3 },
    { id: 4, name: "D", age: 4 },
    { id: 5, name: "E", age: 5 },
    { id: 6, name: "F", age: 6 },
  ]);

  let Card = styled("div")`
    border: 3px solid #333;
  `;

  let CardLine = styled("span")`
