  `;

  return (
    <div>
      <div className="container-lg" style={{ marginTop: "100px" }}>
        <div className="row justify-content-evenly">
          {list.map((item, index) => {
            return (
              <Card
                className="col-3"
                key={index}
                style={{ margin: "20px 20px" }}
              >
                <p>{item.name}</p>
                <p>{item.age}</p>
              </Card>
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default TestList;
